number = (
    ""
)

def proddig(s):
    prod = 1
    for char in s:
        prod *= int(char)
    return prod

maxprod = 0

for i in range(len(number) - 12):
    substring = number[i:i+13]
    
    if '0' in substring:
        continue
    
    currprod = proddig(substring)
    
    if currprod > maxprod:
        maxprod = currprod

print(maxprod)

